create table tb_category (id int8 generated by default as identity, name varchar(255), primary key (id));
create table tb_customer (id int8 generated by default as identity, birth_date TIMESTAMP WITHOUT TIME ZONE, created_at TIMESTAMP WITHOUT TIME ZONE, email varchar(255), first_name varchar(255), last_name varchar(255), monthly_income float8, updated_at TIMESTAMP WITHOUT TIME ZONE, primary key (id));
create table tb_password_reset_token (id int8 generated by default as identity, expiry_date timestamp, token varchar(255), user_id int8, primary key (id));
create table tb_payment (moment TIMESTAMP WITHOUT TIME ZONE, sale_id int8 not null, primary key (sale_id));
create table tb_product (id int8 generated by default as identity, description TEXT, img_url varchar(255), name varchar(255), price float8, primary key (id));
create table tb_product_category (product_id int8 not null, category_id int8 not null, primary key (product_id, category_id));
create table tb_role (id int8 generated by default as identity, authority varchar(255), primary key (id));
create table tb_sale (id int8 generated by default as identity, calls int4, date TIMESTAMP WITHOUT TIME ZONE, status int4, customer_id int8, seller_id int8, primary key (id));
create table tb_sale_item (price float8, quantity int4, product_id int8 not null, sale_id int8 not null, primary key (product_id, sale_id));
create table tb_team (id int8 generated by default as identity, img_url varchar(255), name varchar(255), primary key (id));
create table tb_team_manager (team_id int8 not null, manager_id int8 not null);
create table tb_user (id int8 generated by default as identity, email varchar(255), img_url varchar(255), name varchar(255), password varchar(255), team_id int8, primary key (id));
create table tb_user_role (user_id int8 not null, role_id int8 not null, primary key (user_id, role_id));
